// File: src/components/AuthTestButton.js

import React, { useState } from 'react';
import { Button } from 'react-bootstrap';

const AuthTestButton = () => {
  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState(null);

  const handleCheckCustomer = async () => {
    setLoading(true);

    // Hardcoded variables for testing
    const phone = '5555551014';
    const bearerToken =
      'eyJhbGciOiJIUzUxMiJ9.eyJzdWIiOiJ3ZWVkaHVycnlwYXJ0bmVyc2FuZGJveDJhcGkiLCJhdWRpZW5jZSI6InVua25vd24iLCJjcmVhdGVkIjoxNzMxNzg4NDU5MjkxLCJleHAiOjE3MzE3OTU2NTksImF1dGhvcml0aWVzIjoiVVNFUiJ9.Woz03rXr7_LVff29wrHuL4-Fm8mD26P1dnQB7BtsplgQ0zCFwj6IWi45z1-SBTYB3_wZF8hqwqkJL8TP7V0YyQ';
    const clientId = 'wNzewkHXh2P5GnfCFPX3AmeA';

    try {
      // Make API call to check if customer exists
      const response = await fetch(
        `https://api.treez.io/v2.0/dispensary/partnersandbox2/customer/phone/${phone}`,
        {
          method: 'GET',
          headers: {
            Authorization: `Bearer ${bearerToken}`,
            client_id: clientId,
          },
        }
      );

      const statusCode = response.status;
      const data = await response.json();

      // Check and display response
      if (statusCode === 200 && data.resultCode === 'SUCCESS') {
        setResult(`Customer Data:\n${JSON.stringify(data, null, 2)}`);
        alert(`Customer Data:\n${JSON.stringify(data, null, 2)}`);
      } else {
        setResult(`Customer not found or error occurred.`);
        alert(`Error:\n${data.resultReason || 'Unknown error'}`);
      }
    } catch (error) {
      // Handle and display errors
      setResult(`Error occurred:\n${error.message}`);
      alert(`Error occurred:\n${error.message}`);
      console.error('Error details:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="d-flex flex-column align-items-center mt-5">
      <Button
        variant="primary"
        onClick={handleCheckCustomer}
        disabled={loading}
        className="test-auth-button"
      >
        {loading ? 'Checking...' : 'Check Customer by Phone'}
      </Button>
      {result && (
        <div className="mt-3 text-center">
          <strong>Result:</strong>
          <pre style={{ textAlign: 'left' }}>{result}</pre>
        </div>
      )}
    </div>
  );
};

export default AuthTestButton;
